(3, 1, 2, 'Hijabers Surabaya', '2015-06-05', '2015-06-20', 'Blok C terdapat 8 stan kosong seluas 3m x 3m. terdapat 1 Meja berukuran 2m x 1m beserta 1 kursi dan 1 colokan listrik', 'Dalam acara ini kami mengundang seluruh komunitas hijabers di Surabaya dan beberapa artis ibukota yang memakai Hijab. Jumlah potensial pengunjung yang datang berkisar 500-600 orang dalam 1 hari acara tersebut. Kemudian untuk segmentasi nya kami lebih kearah hijab style untuk kalangan muda.', 350000, 'Acara  ini diperuntukkan untuk para Hijabers di Surabaya. Acara ini diadakan hanya 1 hari saja pada tanggal 5 Agustus 2015. Dimulai dari jam 13.00 WIB hingga pukul 22.00 WIB Tempat pelaksanaan di Gramedia Expo Jl Basuki Rahmat. Lebih tepatnya di Aula B Gramedia Expo lantai 1. ', 'hijabersurabaya', 'hijabersurabaya', ''),
