(7, 1, 1, 'Food Festival Surabaya', '2015-06-08', '2015-06-30', 'kami sediakan 1 blok untuk makanan. Blok A stan makanan berukuran 3mx2m. terdapat 1 meja berukuran 2mx1m , 2 kursi, dan 1 colokan listrik. untuk kompor, gas dan alat masak lainnya bisa membawa sendiri. Blok B stan makanan berukuran 2mx1m, terdapat 1 meja ', 'cocok untuk para penjual makanan khas tradisional indonesia karena tema acara yang di ambil kali ini adalah cinta produk lokal. lokasi acara di tengah Mall terbesar di surabaya. dipastikan acara ini akan dipenuhi pecinta kuliner tradisional di Surabaya.', 500000, 'Acara Food festival kali ini memakai tema    cintai produk lokal. segala bentuk produk makanan yang bisa ikut serta hanya makanan tradisional. tetapi jika ada kreasi atau fusion tertentu boleh ikut namun harus tetap menonjolkan lokalitasnya ', 'FoodFestivalSurabaya', 'FoodFestivalSurabaya', ''),
(8, 1, 1, 'Steak Indonesia', '2015-06-17', '2015-06-30', 'stan berukuran 3mx4m , terdapat 2 colokan listrik, masing-masing mendapatkan tenda seukuran dengan stan. segala peralatan untuk menunjang berjualan boleh dibawa.', 'pengunjung yang datang diperkirakan lebih dari 1000 orang per-hari nya. mereka ingin merasakan taste steak yang memiliki ciri khas nusantara. produk-produk steak unik dan kreatif sangat cocok untuk menyewa stan ini', 800000, 'acara Steak Indonesia ini diadakan  selama 3 hari. di lapangan parkir depan mall terbesar di Surabaya. di meriahkan juga dengan beberapa artis lokal surabaya dan ibukota. acara akan di mulai dari jam 10.00 sampai 22.00', 'steakindonesia', 'steakindonesia', ''),
(9, 1, 1, 'Pecel Indonesia ', '2015-06-09', '2015-06-21', 'stan berukuran 3mx2m dengan 1 meja berukuran 2mx1m  dan 2 buah kursi. kami juga menyediakan 1 buah gas LPG dan 1 colokan listrik. selebih nya dari itu bisa dipersiapkan sendiri.', 'Potensial pengunjung seluruh masyarakat Surabaya pecinta pecel Nusantara. pengisi Stan yang cocok adalah produk-produk pecel dari berbagai daerah yang ada di Indonesia. jika anda memiliki ciri khas itu menambah nilai jual produk anda', 10000000, 'acara Pecel Indonesia bekerja sama dengan berbagai media patner dan lokasi yang strategis di parkir selatan Mall y yang bisa di akses seluruh pengunjung Mall tersebut. acara ini diadakan 3 hari berturut-turut dan diramaikan berbagai hiburan lokal khas surabaya seperti Ludruk dan tarian-tarian daerah sekitar', 'PecelIndonesia', 'PecelIndonesia', ''),
(10, 1, 2, 'Urban Fashionista Surabaya', '2015-06-11', '2015-06-23', 'terdapat stan berukuran 4mx5m, kami sediakan 1 manekin full body setiap stan. terdapat 1 meja berukuran 2mx1m dan 2 kursi. selebihnya bisa dipersiapkan sendiri dan bukan barang yang dapat menimbulkan kebakaran.', 'Potensial pengunjung kalangan menengah keatas. bagi pemeliki usaha baju dengan design glamour dan aksesoris trendy sangat pas untuk membuka stan disini. akses ke lokasi mudah dijangkau di bagian atrium mall x dan akan ramai karena acara pelaksanaa pada hari minggu', 600000, 'acara Urban fashionista surabaya dimeriahkan dengan lomba modeling untuk remaja. walaupun acara utama akan diadakan pada pukul 15.00 tetapi untuk acara bazaarnya akan dilaksanakan dari jam 12.00 hinggan pukul 21.30.', 'UrbanFashionistaSurabaya', 'UrbanFashionistaSurabaya', ''),
(11, 1, 2, 'Pasar Secondhand Surabaya', '2015-06-17', '2015-06-30', 'stan seluas 3mx2m untuk 70 pengisi stan. fasilitas yang kami berikan meja sebesar 1mx1m dan 1 kursi. kemudian kami juga memberikan fasilitas listrik di setiap stan yang ada', 'Potensial pengunjung siswa SMA/mahasiswa dari seluruh Surabaya bahkan daerah sekitar seperti gresik atau sidoarjo. acara diadakan pada weekend selama 3 hari. kami juga bekerja sama dengan seluruh pengurus OSIS SMA se Surabaya dan BEM universitas di Surabaya untuk mempromosikan acara ini.', 1500000, 'Pasar Secondhand Surabaya merupakan Event bazaar barang-barang secondhand di Surabaya. acara ini diadakan di mall tempat biasanya anak muda nongkrong. selama 3 hari pasar Secondhand Surabaya akan diadakan. diramaikan juga dengan beberapa band indie terkenal di Surabaya dan beberapa penampilan komunitas unik di Surabaya ', 'PasarSecondhandSurabaya', 'PasarSecondhandSurabaya', ''),
